import React, { Component } from "react";
import { MDBAlert} from "mdbreact";
import { MDBDataTable } from 'mdbreact';
import { Line } from "react-chartjs-2";
import { MDBContainer } from "mdbreact";
import "./index.css";


class App extends Component {

  state= {
    persons: "gygygygvyugyuvyghy",
  }

  componentDidMount() {
    const apiUrl = 'https://www.quandl.com/api/v3/datasets/EOD/HD?api_key=VfK8ThGsxVxyz-sgZdCh&start_date=2017-12-01&end_date=2017-12-30';
    fetch(apiUrl)
      .then((response) => response.json())
      .then(data => {
        const persons = data.dataset;
        this.setState({ persons });
        console.log(persons.column_names);
      });
      // .then((data) =>  this.setState({ persons }), console.log('This is your data', azx.dataset.data));
  }
  render() {
    
    const numbers = this.state.persons.column_names;
    const doubled = numbers.map((number) => number);
    console.log(doubled);
  
    return (

      
        <div className="container-fluild">
          <MDBAlert color="primary">
               <h1>Fraym FS position - skill test</h1>
          </MDBAlert>
           <div className="card p-3">
             <h1></h1>
             
           </div>

           <div className="container-fluild">
            <div className="card p-3">
                <h3 className="mt-5">Fraym FS position - skill test  </h3>
                <ul>
                {this.state.persons.column_names} 
                     
                </ul>

                <table class="table table-bordered">
                  <thead>
                    <tr>
                      <th scope="col">#</th>
                      <th scope="col">{this.state.persons.column_names} </th>
                      <th scope="col">Last</th>
                      <th scope="col">Handle</th>
                    </tr>
                  </thead>
                  <tbody>
                    <tr>
                      <th scope="row">1</th>
                      <td>Mark</td>
                      <td>Otto</td>
                      <td>@mdo</td>
                    </tr>
                    <tr>
                      <th scope="row">2</th>
                      <td>Jacob</td>
                      <td>Thornton</td>
                      <td>@fat</td>
                    </tr>
                    <tr>
                      <th scope="row">3</th>
                      <td colspan="2">Larry the Bird</td>
                      <td>@twitter</td>
                    </tr>
                  </tbody>
                </table>
                
                <p>visualize the historical trend of end of day stock prices for publicly</p>
                {/* <Line data={this.state.dataLine} options={{ responsive: true }} /> */}
              </div>
            </div>
        </div>
    );
  }
}

export default App;
